import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

const ProjectCL = () => {
  const [project, setProject] = useState([]);
  const [projectName, setProjectName] = useState('');
  const [image, setImage] = useState(null);
  const [description, setDescription] = useState('');
  const [quantity, setQuantity] = useState('');
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [address, setAddress] = useState('');
  const [abilityList, setAbilityList] = useState('');

  const handleProjectNameChange = (e) => {
    setProjectName(e.target.value);
  };

  const handleImageUpload = (e) => {
    setImage(e.target.files[0]);
  };

  const handleDescriptionChange = (e) => {
    setDescription(e.target.value);
  };

  const handleQuantityChange = (e) => {
    setQuantity(e.target.value);
  };

  const handleStartDateChange = (e) => {
    setStartDate(e.target.value);
  };

  const handleEndDateChange = (e) => {
    setEndDate(e.target.value);
  };

  const handleAddressChange = (e) => {
    setAddress(e.target.value);
  };

  const handleAbilityListChange = (e) => {
    setAbilityList(e.target.value);
  };

  useEffect(() => {
    if (projectName.length < 3) {
      console.log('Project name should be at least 3 characters long.');
    }
  }, [projectName]);

  // useEffect to validate the start and end date
  useEffect(() => {
    if (startDate && endDate && startDate > endDate) {
      console.log('End date should be after the start date.');
    }
  }, [startDate, endDate]);

  useEffect(() => {
    fetchProject();
  }, []);

  const fetchProject = async () => {
    try {
      const response = await axios.get(`http://localhost:3000/projects`);
      setProject(response.data);
      console.log(response.data);
    } catch (err) {
      console.error('Error fetching project: ', err);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const formData = new FormData();
      formData.append('projectName', projectName);
      formData.append('image', image);
      formData.append('description', description);
      formData.append('quantity', quantity);
      formData.append('startDate', startDate);
      formData.append('endDate', endDate);
      formData.append('address', address);
      formData.append('abilityList', abilityList);

      // Send the form data to the server
      const response = await axios.post('http://localhost:3000/createProject', formData);

      // Handle the response from the server as needed
      console.log('Server Response:', response.data);
    } catch (error) {
      console.error('Error submitting the form:', error);
    }
  };
  return (
    <div>
      <header class="header">
        <div class="navbar ">
          <ul class="navbar-list">
            <li class="navbar-item">
              <a class="white-text">
                <Link to="/homepageCL">Home</Link>
              </a>
            </li>
            <li class="navbar-item">
              <a class="white-text">
                <Link to="/projects">Projects</Link>
              </a>
            </li>
            <li class="navbar-item">
              <a class="white-text">
                <Link to="/applicatants">Applicatiants</Link>
              </a>
            </li>

          </ul>

          <div class="user">
            <div class="user-img">
              <span class="user-H">
                Q
              </span>
            </div>
            <div class="user-name">
              Minh Quyen
            </div>
          </div>
        </div>
      </header>

      <section class="centent-body">
        <div class="text">
          <h2>CREATE PROJECT</h2>
        </div>
        <form onSubmit={handleSubmit} class="form">
          <label for="uname"><b>Project's Name</b></label>
          <input type="text" placeholder="Enter Project's Name" name="uname" required />

          <label for="imageUpload">Select an Image:</label>
          <input type="file" id="imageUpload" name="imageUpload" />
          <input type="submit" value="Upload" />

          <label>Message</label>
          <textarea cols="90" rows="5" placeholder="Description"></textarea>

          <label for="quantity"><b>Quantity</b></label>
          <input type="number" placeholder="Enter the number of participants" name="quantity" required />

          <label for="dateS">Start Date</label>
          <input type="date" id="dateInput" name="dateInput" />

          <label for="dateE">End Date</label>
          <input type="date" id="dateInput" name="dateInput" />

          <label for="Add">Address</label>
          <input type="text" placeholder="Enter Address" name="Add" required />

          <label for="Abili">Ability List</label>
          <textarea cols="90" rows="5" placeholder="Description"></textarea>

          <button type="submit">SUBMIT</button>

        </form>
      </section>

      <footer class="footer">
        <div class="footer-content-1">
          <div class="footer-content-11">
            <div class="useful-link">
              <span>
                Useful Links
              </span>
              <ul class="useful-link-list">
                <li>
                  Home
                </li>
                <li>
                  About us
                </li>
                <li>
                  Product
                </li>
                <li>
                  Services
                </li>
                <li>
                  Contact us
                </li>

              </ul>
            </div>
            <div class="about-us">
              <span>
                About us
              </span>
              <p>
                Green Summer
              </p>

            </div>
            <div class="Connect-with-us">
              <span>

                Connect with us
              </span>
              <ul>
                <li>
                  <i class="fa-regular fa-comments"></i>
                  Contact us
                </li>
                <li>
                  minhquyen123@grad.uit.edu.vn
                </li>
                <li>
                  0123456789
                </li>

              </ul>
            </div>
          </div>

        </div>
        <div class="footer-content-2">
          <span>
            Copyright Â© Company name
          </span>
        </div>
      </footer>
    </div>
  )
}

export default ProjectCL
